text:
Bummer that this is an Access database. At least posting in a format like CSV would be preferred.

Geodata would be great, too.

@mjs4783, you would have to draw polygons for each of the POPS. Presumably something like MapPLUTO would make doing so much easier, but I'm no expert.

We apologize for the late responses.

@FDNY - Searching for the address using the in dataset search bar, or by using the SODA API in the export tab should work for you.
@Eric - We'll work on adding metadata for this dataset.

We apologize for the delayed response. 
@Arnaud Sahuguet: CCU means Central Corresponding Unit. 
You can read more about it on Page 29 of the following document:
http://www.nyc.gov/html/dsny/downloads/pdf/pubinfo/annual/ar2013.pdf
@Eric and @andrew F: We will work with the appropriate agency  to maintain this data going forward.

We apologize for the delayed response. 

@cclauss: We will pass on your request/suggestion to NYC DOT and will update you once we hear from them.

@mavvaj: The data is current. Please click on the external link and you will get the latest data.

@Sean Zhan: We will pass on your request to NYC DOT and will update you once we hear from them.
